(336, '2014-02-20 09:48:46', 1, 9, '56', 'As is always the case, a great show, full of excitement, passion, energy and tribute to an everlasting gift for humanity.', 3, ''),
(337, '2014-02-20 09:48:46', 1, 9, '55', 'Unbelievable performance! Thoroughly enjoyed this talented group of singers and musicians!', 3, ''),
(338, '2014-02-20 09:48:46', 1, 9, '54', 'Dynamite show by a tight ensemble. Liked that it wasn’t a MJ impersonation; rather just let his music speak for itself. You let the Spirit of Joy in his songs shine thru. Thanks!', 3, ''),
(339, '2014-02-20 09:48:46', 1, 9, '53', 'WOW, WOW, WOW! Foreverland embodies the music, magic, and message of Michael Jackson with their high energy, eclectic show! Everyone needs to see their show!', 3, ''),
(340, '2014-02-20 09:48:46', 1, 9, '52', 'They don’t just play, they dance and bring down the house.', 3, ''),
(341, '2014-02-20 09:48:46', 1, 9, '51', 'I wouldn’t miss your concert for anything. You rocked it again.', 3, ''),
(342, '2014-02-20 09:48:46', 1, 9, '50', 'AMAZING AMAZING AMAZING!!!! What a fantastic performance at the Fairmont Scottsdale Princess tonight. If you ever have the opportunity to catch their show RUN and JUMP at the chance. You do not want t', 3, ''),
(343, '2014-02-20 09:48:46', 1, 9, '49', 'I was part of the AV team and I gotta tell you, that was an amazing show you guys put on! You guys rocked!!!', 3, ''),
(344, '2014-02-20 09:48:46', 1, 9, '48', 'First time seeing you guys, we loved it!! Hope we can make it next year!! Can hardly wait!', 3, ''),
(345, '2014-02-20 09:48:46', 1, 9, '47', 'I’m not usually a fan of cover bands or tribute bands, but you guys had me singing and dancing, too! Definitely a show to see if you want to leave with a smile on your face!', 3, ''),
(346, '2014-02-20 09:48:46', 1, 9, '46', 'My first time seeing the band and they were fantastic. I invited six friends and we were all so impressed. The sound and energy they put out was so great and I danced to almost every song. Happy feet ', 3, ''),
(347, '2014-02-20 09:48:46', 1, 9, '45', 'We see you guys as often as we can, usually in the summer at outdoor venues, but we will make it a habit to get to your indoor venues as well! What a great night and quite possibly the best band worki', 3, ''),
(348, '2014-02-20 09:48:46', 1, 9, '44', 'It was FANTASTIC!!! My boyfriend and I had a great time! We danced the entire night away. People we saw at the beginning of the show weren’t seen again until the end because they were on the dance flo', 3, ''),
(349, '2014-02-20 09:48:46', 1, 9, '43', 'Amaizing!!! Music! Performance! Full of energy, what a great show. Let’s brings bands of this quality more often! Loved every note of it. Thanks so much for coming to Santa Barbara!', 3, ''),
(350, '2014-02-20 09:48:46', 1, 9, '42', 'Thanks for the amazing talent, both musical and theatrical, and energy and precision and passion for Michael Jackson\'s great music, that your all bring to your shows.', 3, ''),
(351, '2014-02-20 09:48:46', 1, 9, '41', 'The show was too good for words.  You guys went beyond the call of duty in terms of entertainment.  The energy that the band put on on this night was beyond belief.  Thank you so much for all that you', 3, ''),
(352, '2014-02-20 09:48:46', 1, 9, '40', 'OMG!  We were there and they were so awesome.  So many songs, done perfectly and their rhythm is electrifying.  Their dance steps, choreography and energy was beyond amazing.  I\'m sure they were havin', 3, ''),
(353, '2014-02-20 09:48:46', 1, 9, '39', 'Thanks for playing at our wedding!  You all did an excellent job and everyone is still talking about how well the band performed.  You truly helped make our wedding unforgettable, and having Michael b', 3, ''),
(354, '2014-02-20 09:48:46', 1, 9, '38', 'Fabulous band.  Seen \'em twice, first at Fox Theater in Redwood City, then Don Quixote\'s in Felton... Unbelievable, and CANNOT sit down while they play.  EXCELLENT!', 3, ''),
(355, '2014-02-20 09:48:46', 1, 9, '37', 'What an amazing show!!!  You guys tore it up!  Such amazing musicians and such an amazing tribute.  The music was off the hook, the dancing great, the voices were simply incredible.  I danced my ass o', 3, ''),
(356, '2014-02-20 09:48:46', 1, 9, '36', 'Great show once again. The performance as a whole was simply amazing.  The singing, dancing, horns and the fact that there are 14 members all together on that one stage, fantastic.  Superb entertainme', 3, ''),
(357, '2014-02-20 09:48:46', 1, 9, '35', 'Great Concert! Fun, energetic, great singing & instrument playing. Hope to see you all again soon.', 3, ''),
(358, '2014-02-20 09:48:46', 1, 9, '34', 'AWESOME AWESOME AWESOME show! Would definitely see it again & definitely telling all my friends about it! I am a huge MJ fan & am so sad I never saw him in concert...this is truly the next best thing!', 3, ''),
(359, '2014-02-20 09:48:46', 1, 9, '33', 'Awesome. Fantastic. Entertaining. So glad I went. Was a near 2 hour drive and well worth the evening. I hope to see you again in the east bay! Great work and you look like you are having a great time ', 3, ''),
(360, '2014-02-20 09:48:46', 1, 9, '32', 'Bought 12 VIP tickets with table reserved upstairs to watch you guys while we celebrated my wife\'s bday this past Sat at Red Devil Lounge. You guys were awesome and we all had a great time! Thanks for', 3, ''),
(361, '2014-02-20 09:48:46', 1, 9, '31', 'To say you guys were beyond expectations is understatement to Infinity! You all were, every one of you were, utterly phenomenal! The singers...WHOA! The horn section? \"I am not worthy!  I am not worth', 3, ''),
(362, '2014-02-20 09:48:46', 1, 9, '30', 'WOW, what a show! This was my first time seeing Foreverland, and I must say that although I was expecting a great time, I did not expect such an incredible level of talent and showmanship. I danced so', 3, ''),
(363, '2014-02-20 09:48:46', 1, 9, '29', 'Show was amazing!! I am a die-hard MJ fan but never had the opportunity to see him perform live. I felt like this was the closest I could get to it. You guys are wonderful performers and musicians. I ', 3, ''),
(364, '2014-02-20 09:48:46', 1, 9, '28', 'I was at the Brooklyn Bowl Tribute concert for MJ . It was fabulous!!!! You guys really nailed it with the singing and all the instruments really gave it that full rich sound that Michael loved. I am ', 3, ''),
(365, '2014-02-20 09:48:46', 1, 9, '27', 'Super sick. Dancing and singing were spot on. Rocked out in the front row for the whole show. AWESOME!!!', 3, ''),
(366, '2014-02-20 09:48:46', 1, 9, '26', 'Saw your show tonight in downtown Pittsburg…loved it! Great sound, great energy, excellent performance! Thanks! We’ll be back!', 3, ''),
(367, '2014-02-20 09:48:46', 1, 9, '25', 'We don’t live in SF and hadn’t researched the planned festivities; we were just there to see the fireworks. Boy, are we glad we happened along as you began your set…you are fantastic!!! Couldn’t belie', 3, ''),
(368, '2014-02-20 09:48:46', 1, 9, '24', 'Great show at Crab Cove! Incredible energy – you rock the house!', 3, ''),
(369, '2014-02-20 09:48:46', 1, 9, '23', 'Saw you guys at Bimbo\'s last night, you freaking killed it, stomped it, and knocked it outta the park! Can\'t wait for June when you are back there. Thanks for a great night.', 3, ''),
(370, '2014-02-20 09:48:46', 1, 9, '22', 'Just got home from your show in Newman… loved, loved, loved it!!! You guys are fantastic and put on one %&*# of a show. Come back again!', 3, ''),
(371, '2014-02-20 09:48:46', 1, 9, '21', 'I attended your show. You were everything I expected and much more. Hope to see you guys again… and again. Thanks for being a group of uncompromising talent!', 3, ''),
(372, '2014-02-20 09:48:46', 1, 9, '20', 'OMG! I saw you guys last Friday evening in Blackhawk Danville! YOU GUYS were AWESOME!', 3, ''),
(373, '2014-02-20 09:48:46', 1, 9, '19', 'That was the best show I’ve see in a long time. Y’all killed it. I have blisters from dancing so much. Thank you.', 3, ''),
(374, '2014-02-20 09:48:46', 1, 9, '18', 'The show last night was awesome! We danced & sang along & had a great time! And I loved that they performed extra songs for us! Their talent, energy, and creativity really honors our pop legend, Micha', 3, ''),
(375, '2014-02-20 09:48:46', 1, 9, '17', 'Wow wow wow wow wow what a great concert! These guys were so entertaining. We enjoyed it so much!!!!! My friends and I feel so blessed to be apart of such a fun and auctioned pack night.', 3, ''),
(376, '2014-02-20 09:48:46', 1, 9, '16', 'A great night! The whole band was a blast…these guys have the formula and worked hard on stage. The horn section was fantastic too. It was super the way the guys coordinated singing and dancing the so', 3, ''),
(377, '2014-02-20 09:48:46', 1, 9, '15', 'Incredible Night!!! Danced for 2 hours solid! These guys are the real deal I hope you come back to Mission Viejo again next year. Best concert in years at the lake… Everyone should see these guys you ', 3, ''),
(378, '2014-02-20 09:50:21', 1, 9, '70', 'What a show. A great tribute to Michael Jackson. If you ever have a chance to see these guys, do not miss it. It’s very rare to see a couple thousand people of all ages that into a concert. Thanks for', 3, ''),
(379, '2014-02-20 09:50:21', 1, 9, '69', 'Always awsome, energetic and fun! Love you guys!!!', 3, ''),
(380, '2014-02-20 09:50:21', 1, 9, '68', 'Me & the wife had a great time. The music was fantastic & the energy was real. Would love to see these guys again. Hopefully they make it close to Vacaville or somewhere in the area. These guys should', 3, ''),
(381, '2014-02-20 09:50:21', 1, 9, '67', 'Every member of your band always puts out 200% without a blink! Thank you for always being such “super stars” in your own right. My group was amazed at the sounds of voice and instrument. Every player', 3, ''),
(382, '2014-02-20 09:50:21', 1, 9, '66', 'Really fun show. Great dancing, great vocals and great musicians. High energy and totally entertaining. Everyone was dancing in the aisles. We had a fantastic time!', 3, ''),
(383, '2014-02-20 09:50:21', 1, 9, '65', 'I went to see your 9 o’clock show, I am huge fan of Michael Jackson, so anything that has to do with MJ I’m there. I was very impressed and really enjoyed the show, it was awesome. Can’t wait to see y', 3, ''),
(384, '2014-02-20 09:50:21', 1, 9, '64', 'What a great show! You guys were amazing! I will be bringing many friends with me when you return in November', 3, ''),
(385, '2014-02-20 09:50:21', 1, 9, '63', 'Wow, a great show! You guys have made your concert so fun to be a part of. The singers, the horns, your dance moves, your precision is phenomenal! Matthew Layne….is the best! We hope you will come to ', 3, ''),
(386, '2014-02-20 09:50:21', 1, 9, '62', 'Saw the show tonight at the Avalon in Sunnyvale, you guys are so talented! The show was incredible!!! I want more FOREVERLAND!!! When is the CD coming out? LOVE, LOVE, LOVE you guys!!!', 3, ''),
(387, '2014-02-20 09:50:21', 1, 9, '61', 'Fell in love with your band when I saw you for the first time in Redwood City over the summer. Had to see you again – so went to the Avalon show. OMG – it was such fun. Great great band. I am sold. Wi', 3, ''),
(388, '2014-02-20 09:50:21', 1, 9, '60', 'My husband saw your show at the Grape festival here in Lodi. He told me I need to see you so when your show was in Stockton we went. It was last night. You guys are amazing.I am ready to see you again', 3, ''),
(389, '2014-02-20 09:50:21', 1, 9, '59', 'Fan for life! Vocals and music are dead-on! And the energy from the band is amazing! You look like you’re having as much fun as the crowd. Keep up the great work.', 3, ''),
(390, '2014-02-20 09:50:21', 1, 9, '58', 'Great music. Great dancing and show. You guys rock!', 3, ''),
(391, '2014-02-20 09:50:21', 1, 9, '57', 'I went, not knowing exactly what to expect. Spent the afternoon listening to MJ with my family, getting psyched up. Foreverland BLEW ME AWAY! ', 3, ''),
