INSERT INTO `fidouche_quote` (`id`, `quote`, `source`, `occasion`) VALUES
(1, 'If she would just shut up and blow a couple people... She would have some... worth.', 'AdC', 'on Krystal Metherson'),
(2, 'What are you, some kind of Vampire of Panochial? He just penetrates with his nose a little bit.', 'George Adelson', 'about Mark, probably'),
(3, 'Oh, half-off. That\'s the name of the topless bar I\'m going to open up there.', 'George Adelson', 'on happy hour drink prices'),
(4, 'He\'s fucked a lot of chicks with his beak... They call him Toucancito in South America...', 'George Adelson', 'about Mark, probably'),
(5, 'I cried during <em>Beaches</em>, yo.', 'George Adelson', 'on getting emotional'),
(6, 'I don\'t know what happened to Amelia Earhardt either, but I\'m cool with it.', 'George Adelson', 'about the fate of Mark O\'hara'),
(7, 'This is the tune they used when they scattered my old man\'s ashes.', 'George Adelson', 'on \"Wind Beneath My Wings\"'),
(8, 'A BULLSEYE!', 'Matty Layne', 'on what Amber Jenkins should be for Halloween'),
(9, 'Speaking of Depeche Mode, I wish I was one of those guys.', 'George Adelson', 'on Depeche Mode'),
(10, 'I\'m not a fan of U2. I mean, I like their first four albums.', 'George Adelson', 'on fandom'),
(11, 'I was there to snort whiskey and drink cocaine.', 'George Adelson', 'on... Foreverland, basically'),
(12, 'It\'s gonna smell like a whorehouse at low tide, dude.', 'George Adelson', 'on Don Quixote\'s?'),
(13, 'I\'m pretty sure I\'ll figure out what happened to the settlers on Roanoke Island before HE gets laid.\r\n', 'George Adelson', 'about Manny'),
(14, 'Also, that guy who almost got us a festival gig that one time, he\'s got an 80\'s band called \"Choppin\' Broccoli\"...', 'Mark Edwards', 'on potential co-headliners'),
(15, '¿Dos as many syllables, huh esé?', 'Matty to Carlos', 'on singing \"Human Nature\" in Spanish'),
(16, 'Nils: \"She brought her daughter. Super hot, but she\'s underage.\"<br>\r\nAdC: \"Underage for what??\"', '', ''),
(17, 'Brose: \"Hey George, where\'d you get that pizza?\"<br>\r\nGeorge: \"Hallway. I\'m drunk as shit.\"', '', ''),
(18, 'Don\'t touch my face!', 'Aki', ''),
(19, 'Is this the guy?', '\'Los', ''),
(20, 'JAH-BLESS!', 'Sternberg', ''),
(21, 'That\'s a big Jabba-the-Hut 10-4', 'Chocolos', ''),
(22, 'What\'s up, all you knitters!', 'Brose', 'greeting the Knitting Factory'),
(23, 'Just back from our world-wind tour of Reno, Arizona, and parts therein!', 'Lou-E', ''),
(24, 'Next time you\'re about to say something, think of what you want to say... then don\'t say it.', '\'Los', 'advice on stage banter'),
(25, 'Unrecognizable. ', 'AdC', ''),
(26, 'Fine. I guess I\'ll just dream smaller. ', 'AdC', 'on the practicality of assembling a 30-piece orchestra'),
(27, 'Totally emasculated. Just disappeared. ', 'AdC', 'about his ears. Do you hear that, Nils?'),
(28, '¡Solamente la punta!', 'Brose', 'on the tip'),
(29, 'This isn\'t my first rodeo. ', 'Ari', 'backing it out'),
(30, 'Frrrrrr. ', 'AdC', ''),
(31, 'I can\'t read this!', 'Ricky Gordon', 'on lyrics'),
(32, 'For Jesus!', 'Ricky Gordon', 'instead of lyrics'),
(33, 'She makes us a better band. ', 'Mark', 'about Ashley. Obviously. '),
(34, 'a miles long shit,<br>\r\nthick as lavender', 'a sticker backstage at the Doug Fir', ''),
(35, 'And what are those knuckleheads doing? He\'s selling fucking pianos and Mark\'s at fucking Disneyland.', 'AdC', 'on the priorities of others'),
(36, 'I have an extra space on my Mom\'s boat.. A few blocks from The Gig.', 'Mark Edwards', 'on Housing in Seattle'),
(37, 'Coit Tower? I make my own Coit Tower every morning.', 'Freddy', 'on regularity'),
(38, 'No school, just old.', 'Lou', 'on being \"Old Skool\"');
