INSERT INTO `marketing_testimonial` (`id`, `quote`, `source`, `show_id`, `featured`) VALUES
(1, 'I went, not knowing exactly what to expect. Spent the afternoon listening to MJ with my family, getting psyched up. Foreverland BLEW ME AWAY! ', NULL, NULL, 1),
(2, 'Great music. Great dancing and show. You guys rock!', NULL, NULL, 1),
(3, 'Fan for life! Vocals and music are dead-on! And the energy from the band is amazing! You look like you’re having as much fun as the crowd. Keep up the great work.', NULL, NULL, 1),
(4, 'My husband saw your show at the Grape festival here in Lodi. He told me I need to see you so when your show was in Stockton we went. It was last night. You guys are amazing.I am ready to see you again. I hope you are coming this way again.', NULL, NULL, 1),
(5, 'Fell in love with your band when I saw you for the first time in Redwood City over the summer. Had to see you again – so went to the Avalon show. OMG – it was such fun. Great great band. I am sold. Will be going to as many local venues you are at.', NULL, NULL, 1),
(6, 'Saw the show tonight at the Avalon in Sunnyvale, you guys are so talented! The show was incredible!!! I want more FOREVERLAND!!! When is the CD coming out? LOVE, LOVE, LOVE you guys!!!', NULL, NULL, 1),
(7, 'Wow, a great show! You guys have made your concert so fun to be a part of. The singers, the horns, your dance moves, your precision is phenomenal! Matthew Layne….is the best! We hope you will come to Fresno again. Maybe the Big Fresno Fair 2012??? Thanks for coming to Fresno.', NULL, NULL, 1),
(8, 'What a great show! You guys were amazing! I will be bringing many friends with me when you return in November', NULL, NULL, 1),
(9, 'I went to see your 9 o’clock show, I am huge fan of Michael Jackson, so anything that has to do with MJ I’m there. I was very impressed and really enjoyed the show, it was awesome. Can’t wait to see you guys in November at the Empire.', NULL, NULL, 1),
(10, 'Really fun show. Great dancing, great vocals and great musicians. High energy and totally entertaining. Everyone was dancing in the aisles. We had a fantastic time!', NULL, NULL, 1),
(11, 'Every member of your band always puts out 200% without a blink! Thank you for always being such “super stars” in your own right. My group was amazed at the sounds of voice and instrument. Every player is an equal. Thank you, thank you again.', NULL, NULL, 1),
(12, 'Me & the wife had a great time. The music was fantastic & the energy was real. Would love to see these guys again. Hopefully they make it close to Vacaville or somewhere in the area. These guys should make a big name for themselves in the entertainment industry.', NULL, NULL, 1),
(13, 'Always awsome, energetic and fun! Love you guys!!!', NULL, NULL, 1),
(14, 'What a show. A great tribute to Michael Jackson. If you ever have a chance to see these guys, do not miss it. It’s very rare to see a couple thousand people of all ages that into a concert. Thanks for coming to Lake Mission Viejo, really hope you come back.', NULL, NULL, 1),
(71, 'Incredible Night!!! Danced for 2 hours solid! These guys are the real deal I hope you come back to Mission Viejo again next year. Best concert in years at the lake… Everyone should see these guys you will not regret it!!', NULL, NULL, 1),
(72, 'A great night! The whole band was a blast…these guys have the formula and worked hard on stage. The horn section was fantastic too. It was super the way the guys coordinated singing and dancing the songs…tag teaming..Foreverland did not skimp on their show…if you have a chance to see them you will be delighted…', NULL, NULL, 1),
(73, 'Wow wow wow wow wow what a great concert! These guys were so entertaining. We enjoyed it so much!!!!! My friends and I feel so blessed to be apart of such a fun and action-packed night.', '', NULL, 1),
(74, 'The show last night was awesome! We danced & sang along & had a great time! And I loved that they performed extra songs for us! Their talent, energy, and creativity really honors our pop legend, Michael Jackson!', NULL, NULL, 1),
(75, 'That was the best show I’ve see in a long time. Y’all killed it. I have blisters from dancing so much. Thank you.', NULL, NULL, 1),
(76, 'OMG! I saw you guys last Friday evening in Blackhawk Danville! YOU GUYS were AWESOME!', NULL, NULL, 1),
(77, 'I attended your show. You were everything I expected and much more. Hope to see you guys again… and again. Thanks for being a group of uncompromising talent!', NULL, NULL, 1),
(78, 'Just got home from your show in Newman… loved, loved, loved it!!! You guys are fantastic and put on one %&*# of a show. Come back again!', NULL, NULL, 1),
(79, 'Saw you guys at Bimbo\'s last night, you freaking killed it, stomped it, and knocked it outta the park! Can\'t wait for June when you are back there. Thanks for a great night.', NULL, NULL, 1),
(80, 'Great show at Crab Cove! Incredible energy – you rock the house!', NULL, NULL, 1),
(81, 'We don’t live in SF and hadn’t researched the planned festivities; we were just there to see the fireworks. Boy, are we glad we happened along as you began your set…you are fantastic!!! Couldn’t believe your energy as you masterfully delivered one song after another. I think you covered Michael’s whole career!!! Great!!!', NULL, NULL, 1),
(82, 'Saw your show tonight in downtown Pittsburg…loved it! Great sound, great energy, excellent performance! Thanks! We’ll be back!', NULL, NULL, 1),
(83, 'Super sick. Dancing and singing were spot on. Rocked out in the front row for the whole show. AWESOME!!!', NULL, NULL, 1),
(84, 'I was at the Brooklyn Bowl Tribute concert for MJ . It was fabulous!!!! You guys really nailed it with the singing and all the instruments really gave it that full rich sound that Michael loved. I am so glad I went.The crowd was really into your performance. You are right up there with the best MJ performances I have seen since he passed. Great, great job!!!!!!!! Please come to NYC again ANYTIME!!!!', NULL, NULL, 1),
(85, 'Show was amazing!! I am a die-hard MJ fan but never had the opportunity to see him perform live. I felt like this was the closest I could get to it. You guys are wonderful performers and musicians. I could not stop dancing or smiling the entire evening!', NULL, NULL, 1),
(86, 'WOW, what a show! This was my first time seeing Foreverland, and I must say that although I was expecting a great time, I did not expect such an incredible level of talent and showmanship. I danced so hard, I ended up on stage during “The Girl is Mine”. Ha! It is obvious that you all have a great amount of love and care for the music of MJ, and performing Off the Wall and Thriller in their entireties was an enormous treat for this huge fan. Thank you SO MUCH! I will definitely be seeing you all again! xoxo', NULL, NULL, 1),
(87, 'To say you guys were beyond expectations is understatement to infinity! You all were, every one of you were, utterly phenomenal! The singers...WHOA! The horn section? \"I am not worthy!  I am not worthy!\" The cover of Thriller? OMG Worth the price of admission! People, go to this show! Foreverland is so much fun and SUCH an amazing tribute band...you will have the time of your life!', '', NULL, 1),
(88, 'You guys were awesome and we all had a great time! Thanks for jamming and keeping the MJ spirit alive!', '', NULL, 1),
(89, 'Awesome. Fantastic. Entertaining. So glad I went. Was a near 2 hour drive and well worth the evening. I hope to see you again in the east bay! Great work and you look like you are having a great time entertaining the crowd!!', NULL, NULL, 1),
(90, 'AWESOME AWESOME AWESOME show! Would definitely see it again & definitely telling all my friends about it! I am a huge MJ fan & am so sad I never saw him in concert...this is truly the next best thing! You guys are great!', NULL, NULL, 1),
(91, 'Great Concert! Fun, energetic, great singing & instrument playing. Hope to see you all again soon.', NULL, NULL, 1),
(92, 'Great show once again. The performance as a whole was simply amazing.  The singing, dancing, horns and the fact that there are 14 members all together on that one stage, fantastic.  Superb entertainment... I hope they come back again, because me and my girlfriends will be there for sure... Thanx guys for the show', NULL, NULL, 1),
(93, 'What an amazing show!!!  You guys tore it up!  Such amazing musicians and such an amazing tribute.  The music was off the hook, the dancing great, the voices were simply incredible.  I danced my ass off all night nonstop.  Thank you so much for a wonderful wonderful time!  I\'ll be back again and again and again!', NULL, NULL, 1),
(94, 'Fabulous band.  Seen \'em twice, first at Fox Theater in Redwood City, then Don Quixote\'s in Felton... Unbelievable, and CANNOT sit down while they play.  EXCELLENT!', NULL, NULL, 1),
(95, 'Thanks for playing at our wedding!  You all did an excellent job and everyone is still talking about how well the band performed.  You truly helped make our wedding unforgettable, and having Michael be a part our special day was truly magical.', NULL, NULL, 1),
(96, 'OMG!  We were there and they were so awesome.  So many songs, done perfectly and their rhythm is electrifying.  Their dance steps, choreography and energy was beyond amazing.  I\'m sure they were having as much fun as the crowd was.', NULL, NULL, 1),
(97, 'The show was too good for words.  You guys went beyond the call of duty in terms of entertainment.  The energy that the band put on on this night was beyond belief.  Thank you so much for all that you give.  I have seen you at least ten times, but this show was the BOMB!', NULL, NULL, 1),
(98, 'Thanks for the amazing talent, both musical and theatrical, and energy and precision and passion for Michael Jackson\'s great music, that your all bring to your shows.', NULL, NULL, 1),
(99, 'Amaizing!!! Music! Performance! Full of energy, what a great show. Let’s brings bands of this quality more often! Loved every note of it. Thanks so much for coming to Santa Barbara!', NULL, NULL, 1),
(100, 'It was FANTASTIC!!! My boyfriend and I had a great time! We danced the entire night away. People we saw at the beginning of the show weren’t seen again until the end because they were on the dance floor the entire night. I am a HUGE Michael Jackson fan and Foreverland did right by him. EXCELLENT!!!', NULL, NULL, 1),
(101, 'We see you guys as often as we can, usually in the summer at outdoor venues, but we will make it a habit to get to your indoor venues as well! What a great night and quite possibly the best band working out there! MJ forever, Foreverland forever!', NULL, NULL, 1),
(102, 'My first time seeing the band and they were fantastic. I invited six friends and we were all so impressed. The sound and energy they put out was so great and I danced to almost every song. Happy feet all the way!', NULL, NULL, 1),
(103, 'I’m not usually a fan of cover bands or tribute bands, but you guys had me singing and dancing, too! Definitely a show to see if you want to leave with a smile on your face!', NULL, NULL, 1),
(104, 'First time seeing you guys, we loved it!! Hope we can make it next year!! Can hardly wait!', NULL, NULL, 1),
(105, 'I was part of the AV team and I gotta tell you, that was an amazing show you guys put on! You guys rocked!!!', NULL, NULL, 1),
(106, 'AMAZING AMAZING AMAZING!!!! What a fantastic performance. If you ever have the opportunity to catch their show RUN and JUMP at the chance. You do not want to miss them. I will for sure be at their show if they are in a city near me again!', '', 208, 1),
(107, 'I wouldn’t miss your concert for anything. You rocked it again.', NULL, NULL, 1),
(108, 'They don’t just play, they dance and bring down the house.', NULL, NULL, 1),
(109, 'WOW, WOW, WOW! Foreverland embodies the music, magic, and message of Michael Jackson with their high energy, eclectic show! Everyone needs to see their show!', NULL, NULL, 1),
(110, 'Dynamite show by a tight ensemble. Liked that it wasn’t a MJ impersonation; rather just let his music speak for itself. You let the Spirit of Joy in his songs shine thru. Thanks!', NULL, NULL, 1),
(111, 'Unbelievable performance! Thoroughly enjoyed this talented group of singers and musicians!', NULL, NULL, 1),
(112, 'As is always the case, a great show, full of excitement, passion, energy and tribute to an everlasting gift for humanity.', NULL, NULL, 1),
(113, 'Foreverland is a guaranteed great time! You can’t help but dance all night to the undeniably great music of The King of Pop truly immortalized by this talented group of musicians!', NULL, NULL, 1),
(114, 'I can\'t believe the show you guys put on! So much energy and showmanship and SERIOUS dedication to preserving the personality of MJ\'s music. I will DEFINITELY come again when you\'re in the area, and will bring more friends. Thanks for an awesome night!', 'Trysha Hicks', 431, 1),
(115, 'What an incredible performance! You and the band, from when you first started in, all the way to the close, captivated and motivated the audience. You got them up and kept them there, and it was amazing to watch the effect. Outstanding show.\r\n', 'Brian Aiello, Entertainment Chair, Lafayette Art & Wine Festival', 459, 1),
(116, 'They’re great to work with! I will for sure keep them in mind for future events.', '', 564, 1),
(117, 'Last night I went to see Foreverland at the Doug Fir and it was absolutely incredible. Every single one of those 14 humans is spectacularly talented, wildly energetic and contagiously fun. That was a night of pure joy and musical magic, and if you ever have the chance to see them you would be a fool not to.', 'Randi Murray', 558, 1),
(118, 'Foreverland was simply amazing! They brought the crowds to their feet every time they took the stage.  It was a pleasure working with the entire band. The success of the After-Party would not have been possible without Foreverland’s incredible stage presence and performance.', 'Tisha A. Hong', 566, 1),
(119, 'They never fail to get us moving to the...beat it! So much fun and so much joy in dancing.', '', 609, 0),
(120, 'We were lucky enough to see them here in Portland and it felt like home. Thank you, Foreverland! You\'re amazing!', '', 609, 0),
(121, 'The band was great to work with, and gave an amazing performance as they always do. From the moment they hit the stage the audience was under their spell.', 'Steve Henricksen', 636, 1),
(122, 'Foreverland always kills it - so easy to work with and the crowd loves them! Thank you for helping me support the client with great entertainment. Hopefully we\'ll talk next year!', 'Billy Pacholski, Dreampark Entertainment', 641, 1),
(123, 'The band was as incredible as I knew they would be and they made the night so memorable. They are so talented and have such great energy, I couldn\'t have asked for anything more! It was truly amazing and our guests can\'t stop talking about them!', '', 639, 1),
(124, 'Haven\'t seen a band have that much fun & get the crowd that excited in a long time.  Bravo!', '', 741, 1);
